    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Winnie's desk{% endblock %}

{% block body %}
<div class=\"container\">
    <form method=\"post\">
        {% if error %}
            <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
        {% endif %}

        <h2 id=\"loginTitle\" class=\"center\">Connectez-vous à votre compte</h2>
        <label for=\"inputEmail\">Email  </label>
        <input class=\"inputs\" type=\"email\" value=\"{{ last_username }}\" name=\"email\" id=\"inputEmail\" class=\"form-control\" autocomplete=\"email\" required autofocus>
        <label for=\"inputPassword\">Password  </label>
        <input class=\"inputs\" type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" autocomplete=\"current-password\" required>

        <input type=\"hidden\" name=\"_csrf_token\"
            value=\"{{ csrf_token('authenticate') }}\">

        {#
            Uncomment this section and add a remember_me option below your firewall to activate remember me functionality.
            See https://symfony.com/doc/current/security/remember_me.html

            <div class=\"checkbox mb-3\">
                <label>
                    <input type=\"checkbox\" name=\"_remember_me\"> Remember me
                </label>
            </div>
        #}

        <button class=\"btn btn-lg btn-primary center\" id='loginBtn' type=\"submit\">
            Se connecter
        </button>
    </form>
    <div id=\"createAccountLink\"><p>Si vous n'avez pas encore de compte, veuillez en créer un en cliquant</p> <a href=\"{{ path('register')}}\">ici</a></div>
</div>
{% endblock %}
", "security/login.html.twig", "/Users/guydefontgalland/e-boutique/templates/security/login.html.twig");
